  input: 'TEXT,F3XA,,"The Committee is in receipt of the Commissions Request for Additional
    Information dated 10-05-2007 regarding the following issues.  1) The receipt for
    the Maricopa County Democratic Party was from permissible funds - it was transferred
    to the non-federal account as it was initially intended.  A copy of the transfer
    paperwork has been forwarded to your attention at the FEC  The Contribution from
    the Emerge Arizona was from permissible sources however they have not filed their
    paperwork to become a PAC as of yet so the contribution but was refunded.  A copy
    of the check has been forwarded to your attention at the FEC.  2)  The Contribution
    from Phoenix Firefighters PAC was from permissible sources but it was intended
    for the non-federal account and has been refunded.  A copy of the check has been
    forwarded to your attention at the FEC.  3&4) The totals have been amended due
    to an error found while researching the information for this amendment.  It was
    discovered that there were fees paid and reported to NOVA Information Systems,
    Inc and American Express in error.  These amounts were in fact refunds that were
    also reported on the original report.  During bank reconciliation the bank statements
    report refunds in the same manner as refunds.  The committee will be more cautious
    in the future.  All other totals are correct on this amended report and all subsequent
    reports are being amended to reflect these changes.  5) The $1,000 contribution
    marked as MEMO from Susan Ong is a MEMO entry for the Partner Share of the contribution
    in the same amount from 3200 N First Ave Limited Partnership.  The donor indicated
    that she was the only contributing partner and it was reported as a MEMO as to
    not inflate the total contributions on the report.  6) After reviewing the calculations
    for the Administrative and Voter Drive Categories the Committee has found some
    errors in the actual labeling of the categories of some previously reported transactions.  All
    reports have been amended that this discrepancy affected.  Please note that the
    Committee has several different categories that are being used this calendar year
    to date and are identified as: Administrative, Administrative 2005/2006, GOTV
    2005/2006, Voter ID, Voter ID 2005/2006, Voter Registration, Voter Drive, and
    Voter 2005/2006.  Each of these categories are reported as their own separate
    Year-to-Date totals and is considered to be an acceptable method of calculation
    per the FEC.",'
